Kõhu ultraheli tõlgendamine
Haiguse nõuetekohane diagnoos on selle ravimiseks poolel teel, sest selles protsessis on nii tähtis kasutada kaasaegseid ja kiireid meetodeid. Seega, kui kõhuõõnes leiduvad organid on häiritud, on ultraheliga tegemist protseduuriga, mida ei saa vältida. Uurige, milliseid märke võimalike haiguste analüüsist võib näidata.
Mis kuulub kõhu ultraheli
Seda tüüpi diagnoosi kasutatakse tänapäeval väga laialdaselt, sest kõhuõõne sisaldab inimese organisme sisemisi organeid, mi
... 
e häired: nefroskleroos, põletik, ureetra seinte vähenemine, urotiaas;
- põrn: põrnainfarkt, tsüst, kasvaja, abstsess, põletik nakkuse või parasiitide esinemise tõttu;
- pankreas: tsüst, kasvaja, abstsess, kanalite kõvenemine;
- vedeliku kogunemine kõhuõõnes;
- aneurüsm, vasokonstriktsioon;
- laienenud lümfisõlmed, muutused nende struktuuris.
Maks
- paremalava - pikkus kuni 5 cm, paksus - 12-13 cm;
- vasak ava - kõrgus kuni 10 cm, paksus - mitte üle 7 cm;
- kaldu vertikaalne suurus - kuni 15 cm.
...
ku eksamit duplekssete angioskanatsioonidega hindavad kliinikud keskmiselt 2000-2500 rubla ulatuses. Üksikute organite kontrollimine verevoolu hindamisega nendes maksab umbes 800-1000 rubla.
Seega peaks kõhuõõne ultraheli transkript läbi viima spetsialist, võttes arvesse mitte ainult "normi" numbreid, vaid ka kliiniliste ilmingute alusel. Eespool toodud väärtused aitavad teil veidi teada saada tuvastatud patoloogiast, kuid lõplikku hinnangut peaks andma spetsialist-terapeut või gastroenteroloog.

Sotsiaalpedagoog
Kirsti Mägi
Kooli sotsiaalpedagoogi töö eesmärgiks on koolis esilekerkivate sotsiaalsete probleemide ennetamine ja lahendamine pedagoogiliste meetoditega. Sotsiaalpedagoog on õpilase sotsialiseerimisprotsessi toetaja. Kui lapse esmaseks sotsialiseerijaks on kodu, siis tema ühiskonda integreerimisel on suur roll koolil.
Otsesed töövaldkonnad on:
- kooli ja kodu koostöö;
- tõrjutus kooliklassis ja ühiskonnas;
- koolikohustuse täitmise jälgimine;
- õpi-, käitumis- ja kohanemisraskustega laste ja nende lähikeskkonnaga tegelemine;
- koolivägivallajuhtumite lahendamine;
- laste, vanemate ja õpetajate nõustamine;
- kuriteoennetus ning koostöö lastekaitse-, sotsiaalhoolekande- ja korrakaitsesüsteemidega.
Töös kasutatavad meetodid on: individuaalnõustamine, rühmatöö, võrgustikutöö.
Sotsiaalpedagoogi poole võivad pöörduda õpilased, õpetajad ja lapsevanemad.
